import React from 'react'
import ReactDom from 'react-dom'

import Card from './Card'
import Sdata from './Sdata'
function ncard(val) {
  return (
    <Card imgsrc={val.imgsrc}
      title={val.title}
      fname={val.fname}
      olink={val.olink}
    />
  )
}
ReactDom.render(
  <>
    <h1 style={{ textAlign: "center", margin: "20px 0 20px 0", letterSpacing: "0.5px" }}>List of Netflix Series</h1>
    {Sdata.map(ncard)}
    <Card imgsrc={Sdata[0].imgsrc} title={Sdata[0].title} fname={Sdata[0].fname} olink={Sdata[0].olink} />
    <Card imgsrc={Sdata[1].imgsrc} title={Sdata[1].title} fname={Sdata[1].fname} olink={Sdata[1].olink} />
    <Card imgsrc={Sdata[2].imgsrc} title={Sdata[2].title} fname={Sdata[2].fname} olink={Sdata[2].olink} />
    <Card imgsrc={Sdata[3].imgsrc} title={Sdata[3].title} fname={Sdata[3].fname} olink={Sdata[3].olink} />
    <Card imgsrc={Sdata[0].imgsrc} title={Sdata[0].title} fname={Sdata[0].fname} olink={Sdata[0].olink} />
    <Card imgsrc={Sdata[1].imgsrc} title={Sdata[1].title} fname={Sdata[1].fname} olink={Sdata[1].olink} />
    <Card imgsrc={Sdata[2].imgsrc} title={Sdata[2].title} fname={Sdata[2].fname} olink={Sdata[2].olink} />
    <Card imgsrc={Sdata[3].imgsrc} title={Sdata[3].title} fname={Sdata[3].fname} olink={Sdata[3].olink} />




  </>, document.getElementById('root')
)
